import React from "react";

export const HomePage = () => {
    return (
        <div className="bg-violet-800">
            <div
                className="h-screen bg-center bg-cover "
                style={{
                    backgroundImage:
                        "url('./../assets/11.png')",
                }}
            >
                <div className="h-full flex items-center justify-center">
                    <h1 className="text-white font-bold text-5xl">
                        A tu Bola Restaurante
                    </h1>
                </div>
            </div>

            <footer className="bg-gray-800 text-white py-4 px-4">
                <div className="text-2xl font-bold">Nombre del Restaurante</div>
                <div className="text-xl">Dirección</div>
                <div className="text-lg">Teléfono</div>
                <div className="text-lg">Correo Electrónico</div>
            </footer>
        </div>
    );
};
